class GetOldchats {
  bool? isSuccess;
  int? statusCode;
  int? pageNo;
  int? pageSize;
  int? total;
  List<Items>? items;

  GetOldchats(
      {this.isSuccess,
      this.statusCode,
      this.pageNo,
      this.pageSize,
      this.total,
      this.items});

  GetOldchats.fromJson(Map<String, dynamic> json) {
    isSuccess = json['isSuccess'];
    statusCode = json['statusCode'];
    pageNo = json['pageNo'];
    pageSize = json['pageSize'];
    total = json['total'];
    if (json['items'] != null) {
      items = <Items>[];
      json['items'].forEach((v) {
        items!.add(Items.fromJson(v));
      });
    }
  }

  Map<String, dynamic> toJson() {
    final Map<String, dynamic> data = <String, dynamic>{};
    data['isSuccess'] = isSuccess;
    data['statusCode'] = statusCode;
    data['pageNo'] = pageNo;
    data['pageSize'] = pageSize;
    data['total'] = total;
    if (items != null) {
      data['items'] = items!.map((v) => v.toJson()).toList();
    }
    return data;
  }
}

